}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 24 24" xml:space="preserve"><polygon class="aw-theme-iconOutline" fill="#464646" points="16.4,13.6 11.5,8.8 6.6,13.6 7.4,14.4 11,10.7 11,20 12,20 12,10.7 15.6,14.4 "/><polygon class="aw-theme-iconOutline" fill="#464646" points="22,23 1,23 1,16 9,16 9,17 2,17 2,22 21,22 21,17 14,17 14,16 22,16 "/><path class="aw-theme-iconOutline" fill="#464646" d="M22,8H1V1h21V8z M2,7h19V2H2V7z"/></svg>';
